import './ModelX.css'
import modelxback from './components/assets/Desktop-ModelX.jpeg'
import HeaderPage from './HeaderPage'
const ModelX = () => {
    return ( 
        <HeaderPage
        title="Model X"
        background={modelxback}
        description="Hyper"
        range="500km"
        time="3.1s"
        speed="250km/h"
        horsepower="1,100hp"
        first
     />
     );
}
 
export default ModelX;
